import { signOut } from "firebase/auth";
import React from "react";

const Nav = () => {
  return(
  <div className="navbar">
    <span className="logo"> sri's chat</span>

    <div className="user">
        <img src="https://bay.com.mt/wp-content/uploads/2022/11/doge.jpeg.webp" alt =""/>
        <span> dogesh </span>
        <button onClick={() => signOut()}>Log out </button>
    </div>
  </div>
  )
}

export default Nav;
